import { useEffect} from "react"
import { useParams } from "react-router-dom"
import { select_emp_name_id } from "../api"
import { Loading } from "./loading"


export function return_component(number,page,arr){

    if(arr){
        return(                
            <>

            {
                arr[page].map((item,index)=>{
                    return(
                        <Id_name  component_state={number} key={(index)} item={item} />
                    )
                })
            }
            </>)
    }


}

export function Id_name({item,component_state}){


        if(component_state===1){
            return(

                <>
                <table>
                    <thead>
                        <tr>
                            <th>員工編號</th>
                            <th>姓名</th>
                            <th>年度目標</th>
                            <th>態度</th>
                            <th>效率</th>
                            <th>專業</th>
                            <th>績效獎金</th>
                            <th>分數說明</th>
                            <th>罰金遲到</th>
                            <th>衛衣</th>

                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>The table body</td>
                            <td>with two columns</td>
                        </tr>
                    </tbody>
                </table>
                <div className="employee">
                    <input placeholder={item[0]}  type='text'/>
                    <input placeholder={item[1]} type='text'/>
                    <input placeholder={item[2]} type='text'/>
                    <input placeholder={item[4]} type='text'/>
                    <input placeholder={item[5]} type='text'/>
                    <input placeholder={item[6]} type='text'/>
                    <input placeholder={item[7]} type='text'/>
                    <input placeholder={item[8]} type='text'/>
                    <input placeholder={item[9]} type='text'/>
                    <input placeholder={item[10]} type='text'/>
                    <input placeholder={item[11]} type='text'/>
                    <input placeholder={item[12]} type='text'/><br/>
                </div>
            </>
            )


        }
        else if(component_state===2){
            return(
                <div className="employee">
                <input placeholder={item[0]}  type='text'/>
                <input placeholder={item[1]} type='text'/>
                <input placeholder={item[2]} type='text'/>
                <input placeholder={item[3]} type='text'/><br/>
                </div>
            )

        }
        else{
            return(
                <div className="employee">
                <input placeholder={item[0]}  type='text'/>
                <input placeholder={item[1]} type='text'/><br/>
                </div>
            )

        }


}
